  }
})

function App() {
  return (
    <Container maxWidth="xs"> 
      <div className="App">
        <header className="App-header">
          <Card />
            <br />
            <TextField
              variant = "filled"
              type = "휴대폰번호"
              label = "휴대폰번호"
              placeholder = "휴대폰번호"
              />
              <br/>
            <TextField
                variant = "filled"
                type = "비밀번호"
                label = "비밀번호"
                placeholder = "비밀번호"
            />
              <br />
              <Button variant = "contained" color = "white">로그인</Button>
        </header>
      </div>
    </Container>
  );
}

export default App;
